linq:
context.Films.Select(f => new { f.Title, f.Director })
           .Where(f =>!context.FilmMarketEstimations.Any(e => e.FilmId == f.FilmId && e.Market.Country == "China"))
           .ToList();

context.Trains.Select(t => new
{
    Name = t.Name,
    Service = t.Service
})
.OrderBy(t => t.Time)
.ToList();

context.Students
   .GroupBy(s => s.StuId)
   .Select(g => new
    {
        Count = g.Count(),
        StuId = g.Key
    })
   .ToList();
